import AdminProductList from "../../Components/AdminProductList/AdminProductList";
import AdminPageHeading from "../../Components/AdminPageHeading/AdminPageHeading";
import AdminPageAddProduct from "../../Components/AdminPageAddProduct/AdminPageAddProduct";
import {useState} from 'react'
import { AddProductVisibilityProvider } from "../../HelperFunctions/AddProductVisibilityContext";

const AdminPage = () => {

  
  return (
    <AddProductVisibilityProvider><div className="AdminPageWrapper">
      <AdminPageHeading toggleAddProductVisible={toggleAddProductVisible}/>
      {isAddProductVisible && <AdminPageAddProduct toggleAddProductVisible={toggleAddProductVisible}/>}
      <AdminProductList />
    </div></AddProductVisibilityProvider>
    
  );
};

export default AdminPage;
